// NewQuotes

import QuoteForm from "../components/quotes/QuoteForm";

function Middle() {
  const addQuotesHandler = (quoteData) => {
    console.log(quoteData);
  };
  return (
    <>
      <div>Add New Quotes</div>
      <QuoteForm onAddQuote={addQuotesHandler} />
    </>
  );
}

export default Middle;
